import { USER_REQUEST, USER_SUCCESS, USER_FAILURE, CREATE_USER, UPDATE_USER, DELETE_USER } from '../actions/types';
import axios from 'axios';

export const fetchUser = (token) => dispatch => {
    dispatch({ type: USER_REQUEST })
    debugger
    const config = {
        headers: {
            "Content-Type": "application/json",
            Authorization: token
        }
    }
    return axios.get('http://localhost:3000/profile',  config ).then(user => console.log("From fetch User in UsersActions",user))
}
